                </CForm>
              </CCardBody>
              <CCardFooter>
                <CButton type="submit" size="sm" color="success">
                  <CIcon name="cil-scrubber" /> Submit
                </CButton>
                <CButton type="reset" size="sm" color="danger">
                  <CIcon name="cil-ban" /> Reset
                </CButton>
              </CCardFooter>
            </CCard>
          </CCol>
        </CRow>
        <CRow>
          <CCol>
            <CCard>
              <CCardHeader>Friends List</CCardHeader>
              <CCardBody>
                <br />

